import React from 'react';
import { NavBar, Hero } from 'bulma';

import './App.css';

class Navbar extends React.Component {

  render() {

    console.log('State: ', this.state);

    return(


<Navbar
        /* color={select('Color', colors)}
        fixed={select('Fixed', { default: undefined, top: 'top', bottom: 'bottom' })}
        active={boolean('Active', false)}
        transparent={boolean('Transparent', false)} */
      >
        <Navbar.Brand>
          <Navbar.Item renderAs="a" href="#">
            <img src="https://bulma.io/images/bulma-logo.png" alt="Bulma: a modern CSS framework based on Flexbox" width="112" height="28" />
          </Navbar.Item>
          <Navbar.Burger />
        </Navbar.Brand>
        <Navbar.Menu >
          <Navbar.Container>
            <Navbar.Item dropdown hoverable href="#">
              <Navbar.Link arrowless={boolean('Arrowless', false)}>
                First
              </Navbar.Link>
              <Navbar.Dropdown>
                <Navbar.Item href="#">
                  Subitem 1
                </Navbar.Item>
                <Navbar.Item href="#">
                  Subitem 2
                </Navbar.Item>
              </Navbar.Dropdown>
            </Navbar.Item>
            <Navbar.Item href="#">
              Second
            </Navbar.Item>
          </Navbar.Container>
          <Navbar.Container position="end">
            <Navbar.Item href="#">
                  At the end
            </Navbar.Item>
          </Navbar.Container>
        </Navbar.Menu>
      </Navbar>


      /* <NavBar className="hero is-fullheight">
          <p className="nav-title">Scout Inc. Database</p>
      </NavBar> */
    );
  }
}

export default NavBar;
